Happy Mother’s Day to the French and Swedish mothers 💐🫶

About last Dior event at the Galeries Lafayettes Paris 🥂⭐️…
Lucky perfume 🍀🤍: It is the scent of the Lilly of the Valley. But as this flower is « mute » it is made with some white flowers 🤍🤍🤍 (floral and green scent). 

Monsieur Dior carried on him a sprig of the Lilly of the Valley and sewed one too during the fashion shows into the dresses to bring luck 🍀 

Do you love floral and green perfumes ? 

Happy Sunday ⭐️

