About Chanel…. And Deauville : 

Pic 1 : Paris-Deauville from the collection « Les Eaux de Chanel » 

Pic 2 : The story of Gabrielle Chanel who opened here her second hat shop in 1912 in Deauville (Normandy). You can see it at the entrance of the city. 

Pic 3 : The commemorative plaque designed by Karl Lagerfeld (sealed in July 15, 2011 on the facade where Gabrielle Chanel’s old store was). 

Pic 4-6 : Hotel Le Normandy where you can also find « Les Eaux de Chanel » 

Pic 7-9 : Others of my Chanel details in Deauville 

Happy Monday and happy new week ✨✨

All photos were taken by me 📸

